import strings from "../strings.json";
import Button from "../components/Button";

function Hero() {
    return <div className="auto hero">
        <h1 className="mb-1">{strings.english.hero.title}</h1>
        <h2 className="mb-2">{strings.english.hero.subtitle}: Israel</h2>
        <div>
            <Button className="mr-2">Mortgage Relief</Button>
            <Button disabled={true} tooltip="Coming soon">Small Business Aid</Button>
        </div>
    </div>
}

export default Hero;
